(179, 21, 'en', 'About', '', '<div style=\"box-sizing: border-box; color: #333333; font-family: \'Microsoft YaHei\', tahoma, arial, \'Hiragino Sans GB\', \'\\宋体\', sans-serif; font-size: 14px; background-color: #ffffff; outline: none !important;\">\r\n<div style=\"box-sizing: border-box; font-family: \'Microsoft YaHei\', tahoma, arial, \'Hiragino Sans GB\', \'\\宋体\', sans-serif; outline: none !important;\">\r\n<div style=\"box-sizing: border-box; font-family: \'Microsoft YaHei\', tahoma, arial, \'Hiragino Sans GB\', \'\\宋体\', sans-serif; outline: none !important;\"><span style=\"color: #000000;\"><span style=\"font-family: \'Microsoft YaHei\', tahoma, arial, \'Hiragino Sans GB\', 宋体, sans-serif;\"><span style=\"font-size: 14px;\">Chengdu Guangda Network Technology Co., Ltd.</span></span><span style=\"font-family: \'Microsoft YaHei\', tahoma, arial, \'Hiragino Sans GB\', 宋体, sans-serif;\"><span style=\"font-size: 14px;\">&nbsp;is a high-tech enterprise mainly engaged in the development of Internet independent station systems.</span></span></span></div>\r\n<div style=\"box-sizing: border-box; font-family: \'Microsoft YaHei\', tahoma, arial, \'Hiragino Sans GB\', \'\\宋体\', sans-serif; outline: none !important;\"><span style=\"color: #000000;\"><span style=\"font-family: \'Microsoft YaHei\', tahoma, arial, \'Hiragino Sans GB\', 宋体, sans-serif;\"><span style=\"font-size: 14px;\">We provide commercial technical support, secondary development, mobile app customization and template design related to cross-border open source e-commerce website construction.</span></span></span></div>\r\n<div style=\"box-sizing: border-box; font-family: \'Microsoft YaHei\', tahoma, arial, \'Hiragino Sans GB\', \'\\宋体\', sans-serif; outline: none !important;\"><span style=\"color: #000000;\"><span style=\"font-family: \'Microsoft YaHei\', tahoma, arial, \'Hiragino Sans GB\', 宋体, sans-serif;\"><span style=\"font-size: 14px;\">&nbsp;</span></span></span></div>\r\n<div style=\"box-sizing: border-