(180, 21, 'zh_cn', '关于我们', '', '<div style=\"box-sizing: border-box; color: #333333; font-family: \'Microsoft YaHei\', tahoma, arial, \'Hiragino Sans GB\', \'\\宋体\', sans-serif; font-size: 14px; background-color: #ffffff; outline: none !important;\"><span style=\"box-sizing: border-box; color: #3ca6f2; outline: none !important;\"><strong style=\"box-sizing: border-box; outline: none !important;\"><a style=\"box-sizing: border-box; background-color: transparent; color: #175199; text-decoration-line: none; outline: none !important;\" href=\"http:\\/\\/www.guangdawangluo.com\\/\" target=\"_blank\" rel=\"noopener\">成都光大网络科技有限公司</a></strong></span>，是一家主要从事互联网独立站系统开发的高科技企业。</div>\r\n<div style=\"box-sizing: border-box; color: #333333; font-family: \'Microsoft YaHei\', tahoma, arial, \'Hiragino Sans GB\', \'\\宋体\', sans-serif; font-size: 14px; background-color: #ffffff; outline: none !important;\"><hr style=\"box-sizing: content-box; height: 0px; margin-top: 20px; margin-bottom: 20px; border-right-style: initial; border-bottom-style: initial; border-left-style: initial; border-image: initial; outline: none !important; border-color: #eeeeee initial initial initial;\" \\/></div>\r\n<div style=\"box-sizing: border-box; color: #333333; font-family: \'Microsoft YaHei\', tahoma, arial, \'Hiragino Sans GB\', \'\\宋体\', sans-serif; font-size: 14px; background-color: #ffffff; outline: none !important;\">我们提供跨境开源电商建站相关的商业技术支持、二次开发、手机商城 App 定制和模板设计。</div>\r\n<div style=\"box-sizing: border-box; color: #333333; font-family: \'Microsoft YaHei\', tahoma, arial, \'Hiragino Sans GB\', \'\\宋体\', sans-serif; font-size: 14px; background-color: #ffffff; padding-left: 30px; outline: none !important;\">&nbsp;</div>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 14px; color: #333333; font-family: \'Microsoft YaHei\', tahoma, arial, \'Hiragino Sans GB\', \'\\宋体\', sans-serif; font-size: 14px; background-color: #ffffff; outline: none !important;\">- 前沿的开源电商独立站系统</p>\r\n<ul>\r\n<li style=\"list-style-type: none;\">\r\n<ul>\r\n<li style=\"box-sizing: border-box; color: #333333; font-family: \'Microsoft YaHei\', tahoma, arial, \'Hiragino Sans GB\', 宋体, sans-serif; font-size: 14px; background-color: #ffffff;\">从pc到手机一体化的建站套餐，适配各种设备，一站式电子商务建站</li>\r\n<li style=\"box-sizing: border-box; color: #333333; font-family: \'Microsoft YaHei\', tahoma, arial, \'Hiragino Sans GB\', 宋体, sans-serif; font-size: 14px; background-color: #ffffff;\">可以解决移动端用户和PC端用户数据互通，一核双店</li>\r\n<li style=\"box-sizing: border-box; color: #333333; font-family: \'Microsoft YaHei\', tahoma, arial, \'Hiragino Sans GB\', 宋体, sans-serif; font-size: 14px; background-color: #ffffff;\"><span style=\"color: #333333; font-family: Microsoft YaHei, tahoma, arial, Hiragino Sans GB, 宋体, sans-serif;\"><span style=\"font-size: 14px;\">系统代码100%开源</span></span></li>\r\n<li style=\"box-sizing: border-box; color: #333333; font-family: \'Microsoft YaHei\', tahoma, arial, \'Hiragino Sans GB\', 宋体, sans-serif; font-size: 14px; background-color: #ffffff;\"><span style=\"color: #333333; font-family: Microsoft YaHei, tahoma, arial, Hiragino Sans GB, 宋体, sans-serif;\"><span style=\"font-size: 14px;\">基于Laravel框架开发</span></span></li>\r\n<li style=\"box-sizing: border-box; color: #333333; font-family: \'Microsoft YaHei\', tahoma, arial, \'Hiragino Sans GB\', 宋体, sans-serif; font-size: 14px; background-color: #ffffff;\"><span style=\"color: #333333; font-family: Microsoft YaHei, tahoma, arial, Hiragino Sans GB, 宋体, sans-serif;\"><span style=\"font-size: 14px;\">强大的插件机制，轻松的功能拓展</span></span></li>\r\n<li style=\"box-sizing: border-box; color: #333333; font-family: \'Microsoft YaHei\', tahoma, arial, \'Hiragino Sans GB\', 宋体, sans-serif; font-size: 14px; background-color: #ffffff;\">商城支持多语言\\/多货币，支付方式多样，支持PayPal、stripe等支付</li>\r\n<li style=\"box-sizing: border-box; color: #333333; font-family: \'Microsoft YaHei\', tahoma, arial, \'Hiragino Sans GB\', 宋体, sans-serif; font-size: 14px; background-color: #ffffff;\"><span styl