(312, 40, 'en', 'Sidegra', '<p><span style=\"white-space: normal;\"> </span></p>\r\n<p>ยา Sidegra</p>\r\n<p>😁😄😁😄泰囯蓝色精灵伟哥小蓝片👨🏻1盒4粒。Sidegra泰国医院唯一指定认可的高端伟哥，中国名叫（西地那非片）👇效果可持续5～6小时，男性成人在房事前1小时，用温水吞服半粒～1粒，每天不超过1粒👌若65岁以上老年人，肝功能障碍，肾功能严重障碍患者请从半粒开始服用‼️严重高血压，心脏病免用🙏🏻</p>\r\n<p>&nbsp;</p>\r\n<p>💙泰囯伟哥Sidegra泰国医院唯一指定认可的高端伟哥，中国名叫西地那非。效果可持续5～6小时，男性成人在房事前1小时，用温水吞服半粒～1粒，每天不超过1粒。若65岁以上老年人，肝功能障碍，肾功能严重障碍患者请从半粒开始服用！严重高血压，心脏病免用</p>\r\n<p>&nbsp;</p>\r\n<p>เป็นยาช่วยทำให้อวัยวะเพศแข็งตัวได้ดีขึ้นและไม่อ่อนตัวขณะมีเพศสัมพันธ์เหมาะสำหรับผู้ที่มีปัญหาดังนี้</p>\r\n<p>&nbsp;</p>\r\n<p>อวัยวะเพศไม่แข็งตัวเวลาที่ต้องการมีเพศสัมพันธ์ (นกเขาไม่ขัน)</p>\r\n<p>2. ขณะมีเพศสัมพันธ์ &ldquo;อวัยวะเพศอ่อนตัว&rdquo;ไม่สามารถแข็งตัวไปจนถึงจุดสุดยอด</p>\r\n<p>หมายเหตุ สินค้าตัวนี้ไม่สามารถแก้ปัญหาเรื่องหลั่งไวได้ถึงแม้จะมีผู้ใช้บางท่านที่ใช้แล้วรู้สึกว่าหลั่งช้าลง</p>\r\n<p>หากท่านต้องการทางเราก็มีผลิตภัณฑ์เพื่อ &ldquo;ชะลอการหลั่ง&rdquo;โดยเฉพาะซึ่งสามารถเลือกได้จากในเมนูด้านซ้ายเลยครับ(ยาชะลอการหลั่งสามารถใช้ร่วมกันกับยาช่วยให้แข็งตัวได้)</p>\r\n<p>&nbsp;</p>\r\n<p>ข้อห้าม (ควรอ่านสำคัญมาก)</p>\r\n<p>&nbsp;</p>\r\n<p>1. ผู้ป่วยโรค หัวใจ หลอดเลือด ความดัน ควรปรึกษาแพทย์ก่อนรับประทาน (เพื่อให้แพทย์ปรับขนาดยาหรืออาจจะห้ามใช้โดยเด็ดขาด) หรือลดขนาดยาลงครึ่งหนึ่งของคนทั่วไป</p>\r\n<p>(สำหรับท่านที่ทานยาเป็นประจำจำพวก ยาไนเตรท ควรปรึกษาแพทย์เช่นกันเนื่องจากฤทธ์ยาจะไปเสริมกันทำให้เกิดอันตรายได้ครับ)</p>\r\n<p>2. ผู้ที่อายุต่ำกว่า 16 ปี และ สตรี ไม่ควรรับประทาน</p>\r\n<p>3. ไม่ควรทานเกิน 100 mg (50mg 2 เม็ด) ต่อวัน และไม่ควรทานกันติดต่อกันทุกวัน</p>\r\n<p>&nbsp;</p>\r\n<p>ในผู้ป่วยเบาหวาน สามารถรับประทานได้ไม่ต้องปรับขนาดยาครับ</p>\r\n<p>ในผู้ป่วยที่มีความผิดปกติของไต CICr น้อยกว่า 30มิลลิลิตรต่อวินาที เริ่มที่ 25 mg</p>\r\n<p>ใน ผู้ป่วยที่มีความผิดปกติของตับระดับอ่อน และปานกลางต้องปรับขนาดยาลง เหลือ 1ใน 4 ครับ สำหรับระดับรุนแรงยังไม่มีการทดสอบ ดังนั้นควรปรึกษาแพทย์ครับ</p>\r\n<p>&nbsp;</p>\r\n<p>ผลข้างเคียงของยา</p>\r\n<p>&nbsp;</p>\r\n<p>มีตั้งแต่ไม่เกิดผล รู้สึกตัวร้อนและหัวใจเต้นเร็ว (ซึ่งเป็นอาการปกติของฤทธิ์ยา)</p>\r\n<p>แต่หากรู้สึกปวดหัวหรือตามัวมองไม่ค่อยชัด(อาการจะเป็นระหว่างในฤทธ์ยา3-6ชม)</p>\r\n<p>แนะนำให้ลดขนาดยาลงครึ่งนึง เช่นทาน 1 เม็ด ก็หักแบ่งเหลือ ครึ่งเม็ด (ในบางกรณีสามารถลดลงเหลือ1ใน4เม็ด)หรือเปลี่ยนตัวยายี่ห้ออื่น</p>\r\n<p>(อาการข้างเคียงขึ้นอยู่กับผู้ใช้ว่าเข้ากับยาตัวไหน โดยขึ้นอยู่กับสภาพร่างกาย อายุ และ กิจวัตรของผู้ใช้)</p>\r\n<p>( ตัวยาหลักถึงจะตัวเดียวกันแต่มีส่วนผสมอื่นๆของแต่ละบริษัททำให้ได้ผลที่แตกต่างกัน)</p>\r\n<p>&nbsp;</p>\r\n<p>การใช้ยาให้มีประสิทธิผล</p>\r\n<p>&nbsp;</p>\r\n<p>1. ทานก่อนมีเพศสัมพันธ์อย่างน้อย ครึ่ง ถึง 1 ชม ถ้าเป็นตอนท้องว่างจะดีที่สุด หรือก่อนอาหารเย็นสักครึ่งชั่วโมง พร้อมน้ำอุ่นๆ ยิ่งอุ่นยิ่งออกฤทธิ์เร็ว (สำหรับท่านที่ไม่เคยใช้แนะนำให้ทานก่อนครึ่งเม็ดหากภายใน 1 ชมไม่เห็นผลค่อยตามอีก ครึ่งเม็ด) เมื่อยาเริ่มออกฤทธิ์แล้วจะมีเวลาถึง 3-4 ชั่วโมง และยังคงมีฤทธิ์จนวันรุ่งขึ้น เรียกว่า นกเขาตื่นขึ้นมาขันแต่เช้าเลยทีเดียว</p>\r\n<p>2. ไม่ควรทานแอลกฮอลล์ เนื่องจากจะทำให้ยาดูดซึมน้อยลงทำให้ประสิทธิภาพยาลดลงครึ่งนึง (หากจำเป็นแนะนำให้ทานหลังยาออกฤทธิ์แล้ว)</p>\r\n<p>3. หากเป็นแบบเม็ด ควรดื่มน้ำตาม ไม่ควรกลืนยาโดยไม่ทานน้ำตาม (น้ำผลไม้ กาแฟอะไรก็ได้ไม่มีปัญหานอกจากแอลกฮอลล์ครับ)</p>\r\n<p>&nbsp;</p>\r\n<p>หมายเหตุ 1.ถ้ากระเพาะมีอาหารมากประสิทธิภาพการออกฤทธิ์จะด้อยลง ควรให้ท้องมีอาหารน้อยๆ</p>', 'Sidegra蓝色精灵伟哥', '', '', '2024-01-29 10:22:33', '2024-01-29 10:22:33');
